-- Step 3: Insert transaction_lines with dimension mapping
    transaction_id,
    line_no,
    account_id,
    classification_id,
    project_id,
    analysis_work_item_id,
    sub_tree_id,
    debit_amount,
    credit_amount,
    description,
    org_id
)
SELECT 
    t.id as transaction_id,
    COALESCE((SELECT MAX(line_no) FROM transaction_lines WHERE transaction_id = t.id), 0) + 
        ROW_NUMBER() OVER (PARTITION BY t.id ORDER BY csv.row_num) as line_no,
    csv.account_id,
    class_map.id as classification_id,
    proj_map.id as project_id,
    anal_map.id as analysis_work_item_id,
    sub_map.id as sub_tree_id,
    csv.debit_amount,
    csv.credit_amount,
    csv.description,
    csv.org_id
FROM temp_csv_transaction_lines csv
JOIN transactions t 
    ON t.reference_number = csv.txn_ref 
    AND t.org_id = csv.org_id
LEFT JOIN transaction_classifications class_map 
    ON CAST(class_map.code AS TEXT) = csv.classification_code 
    AND class_map.org_id = csv.org_id
LEFT JOIN projects proj_map 
    ON CAST(proj_map.code AS TEXT) = csv.project_code 
    AND proj_map.org_id = csv.org_id
LEFT JOIN analysis_work_items anal_map 
    ON CAST(anal_map.code AS TEXT) = csv.analysis_code 
    AND anal_map.org_id = csv.org_id
LEFT JOIN sub_tree sub_map 
    ON CAST(sub_map.code AS TEXT) = csv.subtree_code 
    AND sub_map.org_id = csv.org_id;

-- Step 4: Verify import
DO $$
DECLARE
    v_count INTEGER;
    v_debit NUMERIC;
    v_credit NUMERIC;
    v_balance NUMERIC;
    v_with_class INTEGER;
    v_with_proj INTEGER;
    v_with_anal INTEGER;
    v_with_sub INTEGER;
BEGIN
    SELECT 
        COUNT(*),
        SUM(debit_amount),
        SUM(credit_amount),
        SUM(debit_amount) - SUM(credit_amount),
        COUNT(CASE WHEN classification_id IS NOT NULL THEN 1 END),
        COUNT(CASE WHEN project_id IS NOT NULL THEN 1 END),
        COUNT(CASE WHEN analysis_work_item_id IS NOT NULL THEN 1 END),
        COUNT(CASE WHEN sub_tree_id IS NOT NULL THEN 1 END)
    INTO v_count, v_debit, v_credit, v_balance, v_with_class, v_with_proj, v_with_anal, v_with_sub
    FROM transaction_lines WHERE org_id = 'd5789445-11e3-4ad6-9297-b56521675114';

    RAISE NOTICE '=========================================';
    RAISE NOTICE 'IMPORT VERIFICATION';
    RAISE NOTICE '=========================================';
    RAISE NOTICE 'Total lines: %', v_count;
    RAISE NOTICE 'Total debit: %', v_debit;
    RAISE NOTICE 'Total credit: %', v_credit;
    RAISE NOTICE 'Balance: %', v_balance;
    RAISE NOTICE '';
    RAISE NOTICE 'Dimension Coverage:';
    RAISE NOTICE '  Classification: % (%.1f%%)', v_with_class, (v_with_class::NUMERIC / v_count * 100);
    RAISE NOTICE '  Project: % (%.1f%%)', v_with_proj, (v_with_proj::NUMERIC / v_count * 100);
    RAISE NOTICE '  Analysis: % (%.1f%%)', v_with_anal, (v_with_anal::NUMERIC / v_count * 100);
    RAISE NOTICE '  Sub-tree: % (%.1f%%)', v_with_sub, (v_with_sub::NUMERIC / v_count * 100);
    RAISE NOTICE '';

    IF v_count != 13963 THEN
        RAISE EXCEPTION 'Line count mismatch: expected 13963, got %', v_count;
    END IF;

    IF ABS(v_debit - 905925674.8393677) > 0.01 THEN
        RAISE EXCEPTION 'Debit total mismatch';
    END IF;

    IF ABS(v_credit - 905925674.8393676) > 0.01 THEN
        RAISE EXCEPTION 'Credit total mismatch';
    END IF;

    IF ABS(v_balance) > 0.01 THEN
        RAISE EXCEPTION 'Transactions not balanced: %', v_balance;
    END IF;

    RAISE NOTICE '✅ ALL VERIFICATIONS PASSED';
    RAISE NOTICE '';
END $$;

